import React from "react";

function TodoItem({items}) {
  return (
    <div className="todo">
    {items.map((el)=>{
      <li>
      {el}
      </li>
    })}

      <button className="complete-btn">
        <i className="fas fa-check"></i>
      </button>

      <button className="trash-btn">
        <i className="fas fa-trash"></i>
      </button>
    </div>
  );
}

export default TodoItem;
